#include<iostream>
#include<bits/stdc++.h>
using namespace std;

int main()
{
    int t; 

    cin>>t;

    while(t--){
        string pass;

        cin >> pass;

        if(pass.length() == 1){
            pass.insert(pass.begin() + 1, (char)(pass[0] + 1));
        }
        else{
            bool is_inserted = false;

            for(int i = 0; i < pass.length() - 1; i++ ){
                if(pass[i] == pass[i+1]){
                    if(pass[i] == 'z'){
                        pass.insert(pass.begin() + i + 1, (char)(pass[i] - 1));
                        is_inserted = true;
                        break;
                    }
                   else { pass.insert(pass.begin() + i + 1, (char)(pass[i] + 1));
                    is_inserted = true;
                    break;}
                }
            }

            if(!is_inserted){
                if(pass[0] == 'z'){
                    pass.insert(pass.begin(), (char)(pass[0] -1));
                }
                else pass.insert(pass.begin(), (char)(pass[0] + 1));
                }
                
        }

        cout << pass << endl;
    }
}

